        #     return len(common_list)
        #
        # longest_num = 0
        # for idx, i in enumerate(s):
        #     result = find_longest_substring(idx)
        #     if result > longest_num:
        #         longest_num = result
        #
        # return longest_num

        def find_longest_substring(idx):

            # common_list = []
            common_dict = {}
            common_long = 0
            string = s[idx:]
            for i in string:
                if common_dict.get(i):
                    break
                common_dict[i] = 1
                common_long += 1
            return common_long

        longest_num = 0
        for idx, i in enumerate(s):
            result = find_longest_substring(idx)
            if result > longest_num:
                longest_num = result

        return longest_num


